B.T_=new A.cB("Disabled","The character cannot use [Actions], or [Reactions].",null)
B.SQ=new A.cB("Prone","Melee attacks against the target have advantage, and Range attacks have disadvantage. Moving while prone costs 2 more speed per space. During their turn a character may stand from prone by paying half their speed.",null)
B.SR=new A.cB("Restrained","The character cannot move, or dash during their turn or as the result of their own abilities. They cannot stand from prone. They must succeed in a Dex defense to be able to teleport. If an ally effect would cause the target to no longer be in range of the restraining effect, the effect ends.",null)
B.T4=new A.cB("Regeneration","At the end of your Turn, after Burn and Bleed, roll your regeneration dice and heal equal to the result. Then lose 1 of your Regeneration Dice. This healing happens after bleed & Burn, but can remove the bleed like other healing. Regeneration dice do stack but you may not gain more once you have {2* Vitality} or more regeneration dice.",null)
B.ST=new A.cB("Stunned","The character cannot Move, Dash, use [Actions], or [Reactions]. Attacks made against the target have advantage.",null)
B.SS=new A.cB("Bleed","At the End of your turn, roll your bleed dice and lose that much health ignoring shield and damage resistance. This is not damage. When you are healed, the healer may reduce the healing by the average result of a bleed dice to remove it, removing as many as they can pay for. Bleed stacks. Bleed damage causes the victim to make a concentration check.",null)
B.T0=new A.cB("Burn","Burn vs defense: At the end of your turn, roll your burn dice and take that much damage. During their turn characters can use [Action] or [Reaction] to stop burning for themselves or adjacent allies. During their turn characters can use their item interaction to target themselves or adjacent allies to make a defense of the burn\u2019s type, and on success the burn ends. On failure when targeting allies, the failing character takes the burn damage. Burn stacks but removing burn removes all burn. Burn damage causes the victim to make a concentration check. If the victim is also bleeding or has multiple different types of burn, they make only a single concentrating check for all of them.",null)
B.SX=new A.cB("Melee Attack","A close range attack. When the space adjacent to the enemy across the enemy\u2019s center from your attack is blocked by a creature or terrain, gain advantage on the attack. Allies of the target do not count as blocking for determining flanking.","{attack}")
B.SU=new A.cB("Ranged Attack","A long range attack, If there is an enemy adjacent to you, your ranged attack is made with disadvantage. When your attack targets a single character, check for cover or clear shots. Check 3 corners to matching corners. If 1 corner is blocked by, the attack has disadvantage, if 2 corners are blocked the attack has -1. If all 3 corners are blocked then there isn't a line of effect. If you can check 3 corners without being blocked by anything including allies, you gain a clear shot, gaining +1 to success with the attack.","{attack}")
B.SP=new A.cB("Status Check","Uses your attack level, and is used for ongoing effects. Does not count as an attack for Character Abilities","{attack}")
B.T5=new A.cB("Shield","Your character can gain Shield as the result of using abilities and is lost at the end of the encounter. Shield is lost before HP when damaged. Shield does stack but you may never gain more than your Max Health in Shield.",null)
B.T1=new A.cB("Resistance","When a character has resistance to damage, they reduce the damage taken by half rounded up. Resistance doesn\u2019t stack.",null)
B.T3=new A.cB("[Run]","[Action]: Double your speed this turn.",null)
B.T2=new A.cB("[Retreat]","[Action]: You do not provoke attacks of opportunity by leaving an opponent's reach.",null)
B.SZ=new A.cB("[Ready]","[Action]: You have advantage on Defenses from attacks until the start of your next turn.",null)
B.SW=new A.cB("[Hide]","[Action]: If you have any obscurity to all enemies, you may roll a Conceal Skill vs Wis. If you succeed, you are hidden. If the enemy resists wis attacks, you have disadvantage on the check. You remain hidden until after you make an attack, or any check that affects an enemy or when you end your turn having become adjacent to an enemy at any point. If an enemy becomes adjacent to you outside of your turn, you are no longer hidden.",null)
B.SY=new A.cB("Grapple","[Action]: Roll a Melee Attack against an adjacent enemy\u2019s Str or Dex. If you Success, they are grappled for as long as you are adjacent.  Other players may join in the grapple by succeeding in a grapple check. Whenever a grapple becomes adjacent to another grapple, the two grapples combine.\n\nMoving\nWhen grappled, characters speed is 0. At the end of their turn, they may dash to a free space adjacent to a character in the grapple so long as this wouldn\u2019t cause someone to no longer be connected to the grapple.\n\nAttacking\nWhen grappled, characters have disadvantage on Attacks that do not include at least one of the other grapplers as a target.\n\nWhen attacked\nWhile grappled, attacks from characters not in the grapple have disadvantage. If Both results are Problems, instead the attack Succeeds but targets another random character in the grappled including allies of the attacker.\n\nFlanking\nGrappled Characters may not be flanked except when the target and all flaking characters are in the same Grapple.\n\nEscaping Grapple\nA Character may use an Action or Reaction on their turn to escape grapple. They make a Str or Dex defense, escapers choice. On success, they escape, Leaving the grapple. If them leaving the grapple would cause a character to no longer be connected to the grapple, they have disadvantage on the check.\n\nRestrain\n[Reaction] When a character range 1 who is grappled with you tries to use an [Action] or [Reaction], you may spend your reaction and make a Status Check vs Str. On Success, they do not perform that action or reaction. They do not use any resource or pay costs related to the abilities source.\n\nScrum\nCharacters may move the grapple during their turn if they and their allies are bigger than their opponents. Total the amount of spaces characters and their allies who are in the grapple take up. For each space more than their opponent, they move the whole grapple 1 space. When players move enemies via this method, they are obligated to chat \u201cscrum\u201d while moving the grapple.\n\nSize\nSmall: 0.5 space per character.\nMedium: 1 space per character.\nLarge: 4 spaces per character.\nHuge: 9 spaces per character.",null)
B.SV=new A.cB("Attack of Opportunity","[Reaction]: Whenever a Creature leaves range 1, you may spend your reaction to make a Melee Attack. On Success, deal {Half Level d12} Damage and you may also grapple the target.",null)
