B.a3I=new A.cT("source_craft","Craft","The character gains their powers from consumable creations that they make during combat. At the start of your turn, make a create check, on success gain 1 ingredient. When using an ability, the character must spend 1 ingredient, gaining its effects and a source of {Power} . For every 4 points of this source, the character gains 1 ingredient type from below, minimum 1. Whenever you spend an ingredient, the ingredients type effect is added to the abilities effect. You start each encounter with 1 ingredient of each type you know. Abilities of this source do not require an implement and do not gain any effects from implements, and you may create with 1 free hand. You cannot concentrate on the abilities of this source. When an ability would call for concentration, instead make a status check on the start of each of the target\u2019s turns, on failure the effect ends for the target.\n[Action] gain {Half Power} ingredients of your choice.\n[Reaction] When you fail a status effect check against a target within range 6, spend your reaction and an ingredient to cause the check to succeed instead.","After you succeed on a skill check, gain 1 craft and pick a skill check. You and your allies can use the craft to gain advantage on the check. You may do this up to {Half Crafting pts} each situation. You do not gain crafts for a check in which you used a craft.","{Power}",B.n6,!1,null,null,B.Wp,"{points / 4}",2035632383)
