B.a3J=new A.cT("source_form","Form","The character gains their power through altering their form. Once per encounter, they may transform into their alternate form before they activate one of their form source powers and remain changed as long as they are concentrating. They may only use this source when concentrating on their form, using a source value of {Power}. While in a form, they may concentrate on up to {Power} additional effects. When they lose concentration on their form, they lose concentration on these additional effects.\nYou may have multiple different forms, each different form is considered a separate source, Having its own usage and only being activatable when in the corresponding form. You may be concentrating on multiple forms at the same time, at the start of your turn select one of your forms to use its size, composition and defense class until your next turn. When concentrating on multiple forms, you may use any of those forms abilities regardless of which forms size you select. When concentrating on multiple forms, your extra forms do not grant you the ability to concentrate on extra effects per form.","Evenly divide the skills between your form and out of form. When you are in your form you have advantage on those skills and disadvantage on the other skills. Likewise when out of your form. When you succeed on a skill with disadvantage you change form. At the start of a situation, choose whether you are in your form.","{Power}",B.BZ,!1,null,null,B.Ua,"{1}",4288423856)
B.a3F=new A.cT("source_gadgets","Gadgets","The character gains their powers from created objects. Every combat feature is a unique object or a part in another unique object, that can appear as anything but has the properties of a single Implement selected when you take the feature. When you use the gadget, you have a source value of {Power + 2}. You may use the gadget once, then you must fix the gadget to use it again. If multiple features are in the same object, each feature can be used and fixed independently.\nFix: [Action] fix all of your Gadgets.\nJerryRig: [Reaction] During your or allies turn, you may spend your reaction and fix 1 gadget.","For each of your gadgets, You may gain advantage or +1 on results on a skill check. You may not do this again with this gadget until you either make a skill check with disadvantage or -1 to results.","{Power + 2}",B.n6,!1,null,null,B.h1,null,4294963574)
