B.a3B=new A.cT("source_time","Time","The character gains their power through altering time or predicting the future. After each encounter, you may select your chronomancy from 1 to {half time feature points}. Your time source is {power - chronomancy}. At the start of a situation, Roll and record {Chronomancy +1} attacks and {Chronomancy +1} skills you are proficient in. When you use this source you use one of your applicable chronomancy results, then roll a replacement result. Whenever you have advantage or disadvantage, select 1 result then roll the extra check. If you gain a reroll, reroll as normal. When you change your chronomancy at the end of an encounter, you pick which results are lost, and you only make new rolls for gained chronomancy. You may use an Implement gaining any implement effects. If you do, you require that type of implement to use the feature.","Roll and track {Half Chronomancy} results for {Half Chronomancy} defenses and {Half Chronomancy} skills you aren\u2019t proficient in. Prediction: Before a creature makes a check, [Reaction] and give them one of your applicable chronomancy results for that check as if you had used it.","{power - chronomancy}",B.BY,!0,"Chronomancy",null,B.h1,null,4289773253)
